# two-pointer
def twoSum1(self, numbers, target):
    l, r = 0, len(numbers)-1
    while l < r:
        s = numbers[l] + numbers[r]
        if s == target:
            return [l+1, r+1]
        elif s < target:
            l += 1
        else:
            r -= 1
 
# dictionary           
def twoSum2(self, numbers, target):
    dic = {}
    for i, num in enumerate(numbers):
        if target-num in dic:
            return [dic[target-num]+1, i+1]
        dic[num] = i

# binary search        
def twoSum(self, numbers, target):
    for i in xrange(len(numbers)):
        l, r = i+1, len(numbers)-1
        tmp = target - numbers[i]
        while l <= r:
            mid = l + (r-l)//2
            if numbers[mid] == tmp:
                return [i+1, mid+1]
            elif numbers[mid] < tmp:
                l = mid+1
            else:
                r = mid-1

# 504. Base 7
class Solution(object):
    def convertToBase7(self, num):
        """
        :type num: int
        :rtype: str
        """
        if num == 0:
            return '0'
        else:
            l = []
            iNeg = num < 0
            num = abs(num)
            while num > 0:
                rem = num % 7
                num //= 7
                l.append(rem)
            if iNeg:
                return '-' + ''.join([str(i) for i in list(reversed(l))])
            else:
                return ''.join([str(i) for i in list(reversed(l))])



# 242. Valid Anagram
def isAnagram1(self, s, t):
    dic1, dic2 = {}, {}
    for item in s:
        dic1[item] = dic1.get(item, 0) + 1
    for item in t:
        dic2[item] = dic2.get(item, 0) + 1
    return dic1 == dic2

def isAnagram2(self, s, t):
    dic1, dic2 = [0]*26, [0]*26
    for item in s:
        dic1[ord(item)-ord('a')] += 1
    for item in t:
        dic2[ord(item)-ord('a')] += 1
    return dic1 == dic2
    
def isAnagram3(self, s, t):
    return sorted(s) == sorted(t)


# 476. Number Complement
class Solution(object):
    def findComplement(self, num):
        return -num-1+2**int(math.log(num,2)+1)

# 496. Next Greater Element I
class Solution(object):
    def nextGreaterElement(self, findNums, nums):
        """
        :type findNums: List[int]
        :type nums: List[int]
        :rtype: List[int]
        """
        rslt = [-1] * len(findNums)
        for i in range(len(findNums)):
            j = nums.index(findNums[i]) + 1
            while j < len(nums):
                if nums[j] > findNums[i]:
                    rslt[i] = nums[j]
                    break  # Don't forget this break
                j += 1  # This increment is independent of if clause.
        return rslt

sol = Solution()
findNums = [4, 1, 2]
nums = [1, 3, 4, 2]
sol.nextGreaterElement(findNums, nums)
